import axios from "axios";

const api = axios.create({
    baseURL: "ec2-15-165-205-14.ap-northeast-2.compute.amazonaws.com:8080",
});

export const reviewApi = {
    reviewBoard: () => api.get("/boards"),
    reviewPost: (body) => api.post(`boards`, { ...body }),
};
